import React from 'react'
import Menu from './Menu'

const ShowContact = () => {
  
    return (
      <main>
        {this.props.cont.map(cont => (
          <Menu onShowItem={this.props.onShowCont} key ={cont.id} contact={cont}/>
        ))}
      </main>
    )
}
export default ShowContact
